// n8n Code node (JavaScript) - parse_table (data-first) for ALL items

function titleize(field) {
  return String(field ?? '')
    .replace(/_/g, ' ')
    .replace(/\b\w/g, (c) => c.toUpperCase());
}

function inferValueType(values) {
  const filtered = values.filter(v => v !== null && v !== undefined);
  if (filtered.length === 0) return 'null';

  const kinds = new Set(filtered.map(v => {
    if (typeof v === 'number' && Number.isFinite(v)) return 'number';
    if (typeof v === 'boolean') return 'boolean';
    if (typeof v === 'string') return 'string';
    return 'other';
  }));

  return kinds.size === 1 ? [...kinds][0] : 'mixed';
}

function parseTableData(items) {
  const arr = Array.isArray(items) ? items : [];

  const rows = [];
  const fieldOrder = [];
  const seen = new Set();
  const fieldMeta = {};

  for (const it of arr) {
    const row = {};

    if (it && Object.prototype.hasOwnProperty.call(it, 'date')) {
      row.date = it.date;
    }

    const cols = Array.isArray(it?.columns) ? it.columns : [];
    for (const c of cols) {
      if (!c?.field) continue;

      const key = String(c.field);

      if (!seen.has(key)) {
        seen.add(key);
        fieldOrder.push(key);
        fieldMeta[key] = { sourceType: c?.type ?? null };
      }

      row[key] = ('value' in c) ? c.value : null;
    }

    if (Object.keys(row).some(k => k !== 'date')) {
      rows.push(row);
    }
  }

  const fields = fieldOrder.map(key => {
    const values = rows.map(r => r[key]);
    return {
      key,
      label: titleize(key),
      valueType: inferValueType(values),
      sourceType: fieldMeta[key]?.sourceType ?? null,
    };
  });

  return {
    rowCount: rows.length,
    fields,
    rows,
  };
}

return $input.all().map(({ json }) => {
  // se cair aqui por engano, não quebra
  if (json.status && json.status !== 'ready') {
    const { data, appKey, payload, ...rest } = json;
    return { json: { ...rest, payload: null } };
  }

  const parsed = parseTableData(json.data);

