// Entrada: widget kind="table" com payload { rowCount, fields, rows }
// Saída: adiciona json.analysis com features/preview + tableType

function safeArray(v) {
  return Array.isArray(v) ? v : [];
}

function toNumber(v) {
  const n = Number(v);
  return Number.isFinite(n) ? n : null;
}

function round(n, d = 4) {
  if (!Number.isFinite(n)) return null;
  const p = 10 ** d;
  return Math.round(n * p) / p;
}

function hasKey(fields, key) {
  return safeArray(fields).some(f => f?.key === key);
}

function pick(obj, keys) {
  const out = {};
  for (const k of keys) out[k] = obj?.[k];
  return out;
}

function sampleRows(rows, limit = 10) {
  const arr = safeArray(rows);
  if (arr.length <= limit) return arr;
  return arr.slice(0, limit);
}

function nullStats(fields, rows, sampleLimit = 20) {
  const f = safeArray(fields);
  const r = safeArray(rows);
  if (!f.length || !r.length) return { sampleSize: 0, nullCells: 0, totalCells: 0, nullRate: null };

  const sample = r.slice(0, Math.min(sampleLimit, r.length));
  let nullCells = 0;
  let totalCells = 0;

  for (const row of sample) {
    for (const field of f) {
      const key = field?.key;
      if (!key) continue;
      totalCells += 1;
      const val = row?.[key];
      if (val === null || val === undefined || val === "") nullCells += 1;
    }
  }

  return {
    sampleSize: sample.length,
    nullCells,
    totalCells,
    nullRate: totalCells ? round(nullCells / totalCells, 4) : null
  };
}

// --- Tipo A: keywords
function buildKeywordsAnalysis(payload) {
  const fields = safeArray(payload?.fields);
  const rows = safeArray(payload?.rows);

  // parse numérico
  const parsed = rows
    .map(r => ({
      keyword: r?.keyword ?? null,
      position: toNumber(r?.position),
      change: toNumber(r?.change_from_previous_day),
      competitivity: r?.competitivity ?? null,
      search_volume: r?.search_volume ?? null
    }))
    .filter(x => x.keyword && Number.isFinite(x.position));

  const positions = parsed.map(x => x.position).filter(Number.isFinite);
  const changes = parsed.map(x => x.change).filter(Number.isFinite);

  const avgPos = positions.length ? positions.reduce((a, b) => a + b, 0) / positions.length : null;
  const medianPos = (() => {
    if (!positions.length) return null;
    const s = [...positions].sort((a, b) => a - b);
    const mid = Math.floor(s.length / 2);
    return s.length % 2 ? s[mid] : (s[mid - 1] + s[mid]) / 2;
  })();

  const improving = parsed.filter(x => Number.isFinite(x.change) && x.change < 0).length;
  const worsening = parsed.filter(x => Number.isFinite(x.change) && x.change > 0).length;

  // buckets de posição (heurística simples p/ IA)
  const buckets = {
    top_1_3: parsed.filter(x => x.position <= 3).length,
    top_4_10: parsed.filter(x => x.position >= 4 && x.position <= 10).length,
    mid_11_20: parsed.filter(x => x.position >= 11 && x.position <= 20).length,
    tail_21_50: parsed.filter(x => x.position >= 21 && x.position <= 50).length,
    long_tail_51_plus: parsed.filter(x => x.position >= 51).length
  };

  const best = [...parsed].sort((a, b) => a.position - b.position).slice(0, 10);
  const worst = [...parsed].sort((a, b) => b.position - a.position).slice(0, 10);

  const changeTop = [...parsed]
    .filter(x => Number.isFinite(x.change))
    .sort((a, b) => Math.abs(b.change) - Math.abs(a.change))
    .slice(0, 10);

  const ns = nullStats(fields, rows, 20);

  return {
    tableType: "keywords",
    features: {
      rowCount: toNumber(payload?.rowCount) ?? rows.length,
      fieldCount: fields.length,
      nullRateSample: ns.nullRate,
      nullSampleSize: ns.sampleSize,

      avgPosition: round(avgPos, 2),
      medianPosition: round(medianPos, 2),
      improvingCount: improving,
      worseningCount: worsening,
      positionBuckets: buckets
    },
    preview: {
      fields: fields.map(f => pick(f, ["key", "label", "valueType", "sourceType"])),
      bestKeywords: best,
      worstKeywords: worst,
      biggestDailyChanges: changeTop,
      rowsSample: sampleRows(rows, 8)
    }
  };
}

// --- Tipo B: KPI / adjust (1 linha, valores numéricos)
function buildKpisAnalysis(payload) {
  const fields = safeArray(payload?.fields);
  const rows = safeArray(payload?.rows);
  const row = rows[0] ?? {};

  // pega apenas colunas numéricas (ou nulas) que existirem na linha
  const numericKeys = fields
    .map(f => f?.key)
    .filter(Boolean)
    .filter(k => k !== "date");

  const metrics = {};
  const missing = [];

  for (const k of numericKeys) {
    const v = row?.[k];
    const n = toNumber(v);
    if (v === null || v === undefined) {
      metrics[k] = null;
      missing.push(k);
    } else {
      metrics[k] = n;
      if (n === null) missing.push(k); // valor veio mas não é number
    }
  }

  // heurísticas úteis
  const installs = toNumber(row?.installs);
  const uninstalls = toNumber(row?.uninstalls);
  const dau = toNumber(row?.dau);

  const netInstalls = (installs !== null && uninstalls !== null) ? installs - uninstalls : null;
  const uninstallRate = (installs !== null && uninstalls !== null && installs !== 0) ? uninstalls / installs : null;
  const dauPerInstall = (dau !== null && installs !== null && installs !== 0) ? dau / installs : null;

  const ns = nullStats(fields, rows, 20);

  return {
    tableType: "kpis",
    features: {
      rowCount: toNumber(payload?.rowCount) ?? rows.length,
      fieldCount: fields.length,
      nullRateSample: ns.nullRate,
      nullSampleSize: ns.sampleSize,

      // métricas principais
      installs,
      uninstalls,
      dau,
      account_opening: (row?.account_opening === null || row?.account_opening === undefined) ? null : toNumber(row?.account_opening),

      // derivadas
      netInstalls,
      uninstallRate: uninstallRate !== null ? round(uninstallRate, 4) : null,
      dauPerInstall: dauPerInstall !== null ? round(dauPerInstall, 6) : null,

      missingFields: missing
    },
    preview: {
      fields: fields.map(f => pick(f, ["key", "label", "valueType", "sourceType"])),
      row: row
    }
  };
}

return $input.all().map(({ json }) => {
  const base = {
    ...json, // mantém tudo
  };

  if (json.status !== "ready" || json.kind !== "table" || !json.payload) {
    return { json: { ...base, analysis: null } };
  }

  const payload = json.payload;
  const fields = safeArray(payload?.fields);

  // detecta keywords pelo schema
  const isKeywords =
    hasKey(fields, "keyword") &&
    hasKey(fields, "position") &&
    hasKey(fields, "change_from_previous_day");

  const analysis = isKeywords
    ? buildKeywordsAnalysis(payload)
    : buildKpisAnalysis(payload);

  return {
    json: {
      ...base,
      analysis
    }
  };
});


